//Reference used https://www.pluralsight.com/guides/creating-dynamic-editable-tables-with-reactjs
import React from "react";

export default class App extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            student: {
                date: props.date,
                name: props.name,
                time: props.time
            }
        }
    }

    render() {
        return(
            <div>
                <label>
                    Date:
                </label>
                <input type="date" value={this.state.student.date}/>
                <br/>
                <label>
                    Name:
                    <input type="text" value={this.state.student.name}/>
                </label>
            </div>
        );
    }
}
